import React, { useState, useEffect } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars, faXmark, faCalendarCheck, faAngleUp } from "@fortawesome/free-solid-svg-icons";
import { Link, useNavigate } from "react-router-dom";

const Landingpage = () => {
    const [nav, setNav] = useState(false);

    const openNav = () => {
      setNav(!nav);
    };
  
    return (
      <div
        style={{
          padding: "0 32px",
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          height: "80px",
          backgroundColor: "white",
        }}
      >
        <h1 style={{ fontFamily: "'Poppins', sans-serif" }}>
          <Link to="/" style={{ color: "#1A8EFD", letterSpacing: ".6px", textDecoration: "none" }}>
            Hospital <span style={{ color: "#54de54", fontFamily: "Cambria, sans-serif", fontSize: "40px", fontWeight: "bold" }}>+</span>
          </Link>
        </h1>
  
        {/* Desktop */}
        <ul
          style={{
            listStyleType: "none",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            gap: "32px",
            fontFamily: "'Rubik', sans-serif",
          }}
        >
          <li>
            <Link to="/" style={{ textDecoration: "none", color: "black", fontSize: "18px", letterSpacing: ".8px" }}>
              Home
            </Link>
          </li>
          <li>
            <a href="#services" style={{ textDecoration: "none", color: "black", fontSize: "18px", letterSpacing: ".8px" }}>
              Services
            </a>
          </li>
          <li>
            <a href="#about" style={{ textDecoration: "none", color: "black", fontSize: "18px", letterSpacing: ".8px" }}>
              About
            </a>
          </li>
          <li>
            <a href="#doctors" style={{ textDecoration: "none", color: "black", fontSize: "18px", letterSpacing: ".8px" }}>
              Doctors
            </a>
          </li>
          <li>
            <a href="#contact" style={{ textDecoration: "none", color: "black", fontSize: "18px", letterSpacing: ".8px" }}>
              Contact
            </a>
          </li>
        </ul>
  
        {/* Mobile */}
        <div className={`mobile-hospital-navbar ${nav ? "open-nav" : ""}`}>
          <div onClick={openNav} className="mobile-hospital-navbar-close">
            <FontAwesomeIcon icon={faXmark} className="hamb-icon" />
          </div>
  
          <ul className="mobile-hospital-navbar-links">
            <li>
              <Link onClick={openNav} to="/" style={{ textDecoration: "none", color: "black", fontFamily: "'Poppins', sans-serif", fontWeight: "bold" }}>
                Home
              </Link>
            </li>
            <li>
              <a onClick={openNav} href="#services" style={{ textDecoration: "none", color: "black", fontFamily: "'Poppins', sans-serif", fontWeight: "bold" }}>
                Services
              </a>
            </li>
            <li>
              <a onClick={openNav} href="#about" style={{ textDecoration: "none", color: "black", fontFamily: "'Poppins', sans-serif", fontWeight: "bold" }}>
                About
              </a>
            </li>
            <li>
              <a onClick={openNav} href="#doctors" style={{ textDecoration: "none", color: "black", fontFamily: "'Poppins', sans-serif", fontWeight: "bold" }}>
                Doctors
              </a>
            </li>
            <li>
              <a onClick={openNav} href="#contact" style={{ textDecoration: "none", color: "black", fontFamily: "'Poppins', sans-serif", fontWeight: "bold" }}>
                Contact
              </a>
            </li>
          </ul>
        </div>
  
        {/* Hamburger Icon */}
        <div className="mobile-hospital-nav">
          <FontAwesomeIcon icon={faBars} onClick={openNav} className="hamb-icon" />
        </div>
      </div>
    );
  }
  
  function Hero() {
    const navigate = useNavigate();
    const [goUp, setGoUp] = useState(false);
  
    const scrollToTop = () => {
      window.scrollTo({ top: 0, behavior: "smooth" });
    };
  
    const handleBookAppointmentClick = () => {
      navigate("/appointment");
    };
  
    useEffect(() => {
      const onPageScroll = () => {
        if (window.scrollY > 600) {
          setGoUp(true);
        } else {
          setGoUp(false);
        }
      };
      window.addEventListener("scroll", onPageScroll);
  
      return () => {
        window.removeEventListener("scroll", onPageScroll);
      };
    }, []);
  
    return (
      <div className="section-container">
        <div className="hero-section">
          <div className="text-section">
            <p className="text-headline">❤️ Health comes first</p>
            <h2 className="text-title">
              Find your Doctor and make an Appointments
            </h2>
            <p className="text-descritpion">
              Talk to online doctors and get medical advice, online prescriptions,
              refills and medical notes within minutes. On-demand healthcare
              services at your fingertips.
            </p>
            <button
              className="text-appointment-btn"
              type="button"
              onClick={handleBookAppointmentClick}
            >
              <FontAwesomeIcon icon={faCalendarCheck} /> Book Appointment
            </button>
            <div className="text-stats">
              <div className="text-stats-container">
                <p>145k+</p>
                <p>Receive Patients</p>
              </div>
  
              <div className="text-stats-container">
                <p>50+</p>
                <p>Expert Doctors</p>
              </div>
  
              <div className="text-stats-container">
                <p>10+</p>
                <p>Years of Experience</p>
              </div>
            </div>
          </div>
  
          <div className="hero-image-section">
            <img className="hero-image1" src={Doctor} alt="Doctor" />
          </div>
        </div>
  
        <div
          onClick={scrollToTop}
          className={`scroll-up ${goUp ? "show-scroll" : ""}`}
        >
          <FontAwesomeIcon icon={faAngleUp} />
        </div>
      </div>
    );
  }
  
export default Landingpage;
